import './introText.css';

function introText() {
    return (
        <>
            <h1 className="animation">Bradley Vangelder</h1>

            <h1>Bradley Vangelder</h1>
            <div className="nav">
                <ul>
                    <li><a href="/#">about</a></li>
                    <li><a href="/#">contact</a></li>
                    <li><a href="/#">resume</a></li>
                </ul>
            </div>
        </>
    )
}

export default introText();
